import React, { useState, useEffect } from 'react';
import axios from 'axios';

function PaymentsPage() {
  const [payments, setPayments] = useState([]);
  const [newPayment, setNewPayment] = useState({
    amount: '',
    currency: 'USD',
    provider: 'SWIFT',
    status: 'Pending',
    date: new Date().toISOString().split('T')[0],
    customerId: 1 // Assuming customerId is 1 for testing, replace with actual data
  });

  // Fetch all payments
  const fetchPayments = async () => {
    try {
      const response = await axios.get('/api/payments');
      setPayments(response.data);
    } catch (error) {
      console.error("Error fetching payments", error);
    }
  };

  // Handle form input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewPayment(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  // Handle form submission for creating a new payment
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('/api/payments', newPayment);
      fetchPayments(); // Refresh the list after submission
      setNewPayment({
        amount: '',
        currency: 'USD',
        provider: 'SWIFT',
        status: 'Pending',
        date: new Date().toISOString().split('T')[0],
        customerId: 1
      });
    } catch (error) {
      console.error("Error submitting payment", error);
    }
  };

  // Handle delete payment
  const handleDelete = async (id) => {
    try {
      await axios.delete(`/api/payments/${id}`);
      fetchPayments(); // Refresh the list after deletion
    } catch (error) {
      console.error("Error deleting payment", error);
    }
  };

  useEffect(() => {
    fetchPayments(); // Fetch payments when the component is mounted
  }, []);

  return (
    <div>
      <h2>Payments</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Amount</label>
          <input
            type="number"
            name="amount"
            value={newPayment.amount}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Currency</label>
          <select
            name="currency"
            value={newPayment.currency}
            onChange={handleInputChange}
            required
          >
            <option value="USD">USD</option>
            <option value="EUR">EUR</option>
            <option value="GBP">GBP</option>
            <option value="ZAR">ZAR</option>
          </select>
        </div>
        <div>
          <label>Provider</label>
          <input
            type="text"
            name="provider"
            value={newPayment.provider}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Status</label>
          <input
            type="text"
            name="status"
            value={newPayment.status}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Date</label>
          <input
            type="date"
            name="date"
            value={newPayment.date}
            onChange={handleInputChange}
            required
          />
        </div>
        <button type="submit">Create Payment</button>
      </form>

      <h3>Payment List</h3>
      <ul>
        {payments.map(payment => (
          <li key={payment.id}>
            {payment.amount} {payment.currency} via {payment.provider} - {payment.status} 
            <button onClick={() => handleDelete(payment.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PaymentsPage;
